package config

import (
	"BazarMessenger/domain"
	"context"
	"go.mongodb.org/mongo-driver/bson"
	"go.mongodb.org/mongo-driver/bson/primitive"
	"go.mongodb.org/mongo-driver/mongo"
	"go.mongodb.org/mongo-driver/mongo/options"
	"log"
	"time"
)

var Ctx = context.TODO()

func InitMongodb() *mongo.Collection {
	uri := "mongodb://localhost:27017/"
	clientOptions := options.Client().ApplyURI(uri)
	client, err := mongo.Connect(Ctx, clientOptions)
	if err != nil {
		log.Fatal(err)
	}

	err = client.Ping(Ctx, nil)
	if err != nil {
		log.Fatal(err)
	}

	collection := client.Database("BazarMessenger").Collection("User")
	go SeedData(collection)
	return collection
}
func SeedData(coll *mongo.Collection) {

	filter := bson.D{{}}
	count, err := coll.Database().Collection("User").CountDocuments(Ctx, filter)
	if err != nil {
		panic(err)
	}
	if count <= 0 {
		user := new(domain.User)
		user.ID = primitive.NewObjectID()
		user.FirstName = "mahdi"
		user.LastName = "hp"
		user.CellNumber = "09339466051"
		user.CellNumber = "09339466051"
		user.AreaCode = "+98"
		user.Acive = true
		user.Bio = "I am is A usual human"
		user.Avatar = ""
		user.CreatedAt = time.Now()
		user.UpdatedAt = time.Now()

		_, err = coll.InsertOne(context.TODO(), user)
		if err != nil {
			panic(err)
		}
	}

}
